import React, { Component } from 'react';

const git = [
  {
    cli: "git init",
    usage: "git init [repository name]",
    description: "This command is used to start a new repository.",
    id: '1'
  },
  {
    cli: "git clone",
    usage: "git clone [url] ",
    description: "This command is used to obtain a repository from an existing URL.",
    id: '2'
  },
  {
    cli: "git add",
    usage: "git add [file]",
    description: "This command adds a file to the staging area.",
    id: '3'
  },
]

class Search extends Component {
  render() {
    return(
      <div className="search">
        {
          cli.map(function(git){
            return(
              <div>
                <h2>
                  {git.cli}
                </h2>
                <h2>
                  {git.usage}
                </h2>
                <h2>
                  {git.usage}
                </h2>
                <h2>
                  {git.description}
                </h2>
              </div>
            )
          })
        }
      </div>
    );
  }
}

export default Search;
